import React from "react";
import {Container, Row , Col,Form, Button} from 'react-bootstrap'
function App() {
  return (
    <div className="App ">
      <Container>
        <Row>
          <Col  style={{border:'2px solid red'}}>
          <Form.Control size="lg" type="text" placeholder="enter recherche" />
          <Button variant="primary" size="lg">Search</Button>
          </Col>
        </Row>
        <Row>
          <Col xs={12} lg={8} style={{border:'2px solid red'}}>Single Videos</Col>
          <Col xs={12} lg={4} style={{border:'2px solid red'}}>Suggetion</Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
